package models

import "testing"

func TestGetIceCreamByProductID(t *testing.T) {

	requests := []IceCreamRequest{
		//Required request params
		{
			ProductID: "",
			IsDetail:  true,
		},
		//Length Invalid
		{
			ProductID: "123213213123123123",
			IsDetail:  true,
		},
		{
			ProductID: "asd",
			IsDetail:  true,
		},
	}

	expectedErrors := []map[string]int{
		{
			requiredProductID: 1,
		}, {
			invalidLengthProductID: 1,
		}, {
			notNumericProductID: 1,
		},
	}

	for i := 0; i < len(requests); i++ {

		j := i // Avoids concurrency issues with variable i

		t.Run("", func(t *testing.T) {

			t.Parallel()

			msgs := requests[j].Validate()

			//Assert
			if len(msgs) == 0 {

				t.Errorf("Get Ice Creams by Product ID: failed to validate")

			} else if len(expectedErrors[j]) != len(msgs) {

				t.Errorf("Get Ice Creams by Product ID: failed to validate. scenario %v. expected %v error(s), but returned %v error(s). error description: %v", j, len(expectedErrors[j]), len(msgs), msgs)

			} else {

				for _, vm := range msgs {

					if _, exists := expectedErrors[j][vm.Error]; !exists {

						t.Errorf("Get Ice Creams by Product ID: failed to validate. scenario %v. didn't expect validation error %v", j, vm.Error)

					}

				}
			}

		})
	}

}

